import './App.css';
import React from 'react'
import Sidebar from './containers/Sidebar'
import Main from './containers/Main'
import Topbar from './containers/Topbar'
import Player from './containers/Player'




class App extends React.Component {
    render() {
        return (
            <div className="App">
                <Topbar />
                <Sidebar />
                <Player />
                <Main />
            </div>
        )
    }
} 


export default App;


